import React from 'react'
import Table from "./Table";
import "./reports.css"

const data = [
    { reportID: 1, serviceName: "HTTP", date: "10/2/23", company: "intel", attackerIP: "10.0.2.100", trapName: "Admin", sessionINFO: "hello world" },
    { reportID: 2, serviceName: "FTP", date: "10/2/23", company: "intel", attackerIP: "10.0.2.4", trapName: "Admin", sessionINFO: "hello world" },
    { reportID: 3, serviceName: "SMTP", date: "10/2/23", company: "intel",connectionDuration: "1:25", attackerIP: "10.0.2.2", trapName: "Admin", sessionINFO: "hello world" },
    { reportID: 4, serviceName: "SSH", date: "10/2/23", company: "intel",connectionDuration: "1:25", attackerIP: "10.0.2.100", trapName: "Admin", sessionINFO: "hello world" },
];

function Reports() {

    return (
        <div id="reports">
            <h1 style="text-decoration: underline;">Reports</h1>
            <br/>
            <Table data={data}></Table>
        </div>
    );
}

export default Reports;
